import React, { Component }from 'react';
import {FooterWrap} from "./styles";



class Footer extends Component{
    render() {

        return (
            <FooterWrap>
                <img src='https://www.unifeso.edu.br/images/logo/UNIFESO-BRANCO.png'/>
                
            </FooterWrap>
        )

    }
}

export default Footer
